    justify-content: space-between;

`
export const HomePage = () => {
    return (
    <HomePageBackGround>
        <div className = 'directory-menu'>
            <div className = 'menu-item'>
                <div className = 'content'>
                    <h1> Hats</h1>
                    <h1> Shop Now</h1>
                </div>

            </div>
        </div>

    </HomePageBackGround>
    )
}
